import React from 'react'
import './home.css';

const cardNames = [
  {
    "name" : "students"
  },
  {
    "name" : "Classrooms"
  },
  {
    "name" : "Teachers"
  },
  {
    "name" : "Classrooms"
  },
  {
    "name" : "sample"
  },
  {
    "name" : "sample"
  },
 
];

function home() {
  return (
    <div className='main' >
      <div className='cardmain'>
        
      {cardNames.map((name, index) => (
        <div key={index} className='card'>
          <h1>{name}</h1>
        </div>
      ))}

      </div>
    </div>
  )
}

export default home
